function NotFound (){

return (
	<div className="page">
		 <Header />
		 <div className="notFound">
			<img className="not__found-title" src="" alt="" />
			<h3 className="notFound__title">
			  Ошибка 404
			</h3>
			<p className="notFound__text">
			  Страница не найдена
			</p>
		 </div>
	  </div>


	)
}

export default NotFound;
